import React from "react";
import Navbar from "./navmenu/Navbar";
import Contact from "./Contact";
import { Typography, Box } from "@material-ui/core";
import { useTheme } from "@material-ui/core/styles";
import { makeStyles } from "@material-ui/core/styles";
import animalImg from "../img/animal.jpg";
import angryCatImg from "../img/angrycat.jpg";
import BlogEntry from "./BlogEntry";

const useStyles = makeStyles((theme) => ({
  middleContainer: {
    width: "90%",
    margin: "auto",
    overflow: "hidden",
    [theme.breakpoints.up("md")]: {
      width: "70%",
    },
  },
}));

const Blogs = () => {
  const classes = useStyles();
  const theme = useTheme();
  return (
    <>
      <Navbar />
      <Box className={classes.middleContainer}>
        <Typography
          variant="h1"
          style={{
            margin: "2em 0 .8em 0",
            textAlign: "center",
            fontSize: "2rem",
            lineHeight: "1.15rem",
          }}
        >
          these are my blogs
        </Typography>
        <Typography
          variant="h2"
          style={{
            margin: "0 0 3em 0",
            padding: "0 0 2em 0",
            textAlign: "center",
            fontSize: "1.2rem",
            borderBottom: `2px ${theme.palette.accent1.main} solid`,
          }}
        >
          let's see how this goes
        </Typography>
        <section id="bloglist" class="middle container">
          <h1></h1>
          <h2 class="thinsubtitle"></h2>
        </section>
      </Box>
      <Contact />
    </>
  );
};

export default Blogs;
